import { useState, useEffect } from "react";
import { getRecipes } from "../DAL/api";

function Cart({ match }) {
  console.log(match);
  const [cartList, setCartList] = useState([{recipeId:1},{recipeId:2},{recipeId:1}]);
  useEffect(async () => {
    const recipes = await getRecipes();
    const recipe = recipes.filter((item) => item.recipeId === match.params.id);
    setCartList([...cartList, ...recipe]);
  }, []);
  return (
    <div className="m-auto text-center">
      <h1>Welcome to Cart</h1>
      <ul>
        {cartList.length > 0 &&
          cartList.map((item) => {
            return <li key={item.recipeId}>{item.name}</li>;
          })}
      </ul>
    </div>
  );
}
export default Cart;
